Türkiye de sayısız öğrenci yetiştirmiş olan kurucumuz, By Muammer Mami hocamız. Bir çok üniversite devlet okulları ve tv programları, konserler ve önemli projelerin çalışmalarını hazırlayan hocamız. Sizler dans severler için, özel eğitim programlarına start vermiştir.

Çocuklar için hip hop, modern dans, Çocuk halk dansları kursu eğitimlerimiz başlamıştır. Çocukların dans eğitimi sadece hafta sonları verilmektedir.

Yetişkinlerde düğün ve nışan için giriş dansı eğitimleri verilmektedir. Gelin danslar diledikleri ve Hayalini kurdukları dansı bizimle öğrenebilirler.

Gençler dans konusunda ileriye dönük olarak, profesyonel dans kurslarımıza katılabilirler. Dans  eğitmeni alabilir ve ayrıca profesyonel dans sanatcısı olabilirsiniz. Gençlerimiz diledikleri dans türlerini bizlerle en iyi şekilde öğrenebilir. Kendilerine sunmuş olduğumuz keyifli programlar ayrıca sosyal olabilmeleri konusunda önem göstermektedir.

Bizler hep birlikte büyük kocaman bir aileyiz. 

T.C. MTD DANS AKADEMİ.
